import React from "react";
//import Header from ./Header.js;
import './App.css';

const Nav = function() {
    return (
        <div>
            <nav className="nav">
                <div><a>Profile</a></div>
                <div><a>Messages</a></div>
                <div><a>Music</a></div>
                <div><a>Settings</a></div>
                HiperNav
            </nav> 
        </div>
    );
}

export default Nav;
